import styled from 'styled-components';

export const Conteudo = styled.div `
    width: 100vw;
    height: 100vh;
    display: flex;
    justify-content: center;
    > Button {
        width: 25vw;
        height: 25vw;
        font-size: 2vw;
        margin-left: 3vw;
        margin-right: 3vw;
        margin-top: 20vh;
    }
`;
